import '../App.css';


function MainWrap() {

  return (
    <div className="main-wrap">

        <div class="l-top">score</div>
        <div class="r-top">marks</div>
        <div class="l-bottom">feature</div>
        <div class="r-bottom">explaination</div>

    </div>
  );
}

export default MainWrap;
